import React, { Component } from 'react';

import {
  Link
} from 'react-router-dom'

import streamToArray from 'stream-to-array'

import IPFS_MAIN from 'ipfs'
const ipfs = new IPFS_MAIN()

class ContentCard extends Component {
	componentDidMount(){
		let thumbnail;

		let files = this.props.artifact['oip-041'].artifact.storage.files;
		let mainHash = this.props.artifact['oip-041'].artifact.storage.location;

		for (var i = 0; i < files.length; i++){
			if (files[i].type === "Image" && !thumbnail)
				thumbnail = files[i];
		}

		let thumbnailURL = "";

		if (thumbnail){
			thumbnailURL = mainHash + "/" + thumbnail.fname;
			let type = thumbnail.fname.split('.')[thumbnail.fname.split('.').length - 1];
			if (type === "jpg")
				type = "jpeg";

			this.setState({type: type});
		}

		let _this = this;
		if (thumbnailURL){
			ipfs.files.cat(thumbnailURL, function (err, file) {
				let stream = file;
				let chunks = [];
				if (stream){
					stream.on('data', function(chunk) {
						chunks.push(chunk);

						var reader  = new FileReader();

						reader.addEventListener("load", function () {
							if (reader.result && reader.result != "data:")
								_this.setState({ src: reader.result });
						}, false);

						if (chunks) {
							reader.readAsDataURL(new Blob(chunks));
						}
					});
				}
					
			})
		}	
	}
	componentWillUnmount() {
		if (this.serverRequest){
			try {
				this.serverRequest.abort();
			} catch(e){}
		}
	}
	constructor(props) {
		super(props);
		this.state = {src: "data:;base64,"};
	}
	scrollToTop(){
		window.scrollTo(0, 0);
	}

	render() {
		let thumbnail;

		let txid = this.props.artifact.txid;
		let title = this.props.artifact['oip-041'].artifact.info.title;
		let type = this.props.artifact['oip-041'].artifact.type.split('-')[0];
		let subtype = this.props.artifact['oip-041'].artifact.type.split('-')[1];
		let files = this.props.artifact['oip-041'].artifact.storage.files;
		let mainHash = this.props.artifact['oip-041'].artifact.storage.location;

		let paid = false;
		if (files){
			for (var i = 0; i < files.length; i++){
				if (files[i].sugPlay || files[i].sugBuy)
					paid = true;

				if (files[i].type === "Image" && !thumbnail)
					thumbnail = files[i];
			}
		}

		let thumbnailURL = "";

		if (thumbnail){
			thumbnailURL = "https://gateway.ipfs.io/ipfs/" + mainHash + "/" + encodeURIComponent(thumbnail.fname);
		}

		if (thumbnailURL === ""){
			thumbnailURL = "https://gateway.ipfs.io/ipfs/QmQhoySfbL9j4jbDRSsZaeu3DACVBYW1o9vgs8aZAc5bLP/alexandria-default-posterframe.png"
		}

		let icon;

		switch(type){
			case "Audio":
				icon = "beamed-note";
				break;
			case "Video":
				icon = "clapperboard";
				break;
			case "Image":
				icon = "image";
				break;
			case "Text":
				icon = "text";
				break;
			case "Software":
				icon = "code";
				break;
			case "Web":
				icon = "code";
				break;
			default:
				icon = "";
				break;
		}

		let userIcon = "https://gateway.ipfs.io/ipfs/QmWJ7RhZgktfnAeXn8SS2uahJC56gtkTmyNmycp4p2KheW/usericon_id76rb.png";

		return (
			<Link to={"/" + txid.substring(0,6) } onClick={function(){window.scrollTo(0, 0)}} className="col-xl-3 col-lg-4 col-md-6 col-sm-6 col-12 no-link-styling">
				<div className="card">
					<img className="card-img-top content-card-img" src={this.state.src} alt="" />
					<div style={{marginBottom:"95px", marginTop: "-125px"}}>
						<button className="btn btn-outline-primary btn-white" style={{padding: "3px 5px", border: "none", backgroundColor: "rgba(0,0,0,0.5)"}}>
							{ paid ? <span className="icon icon-credit" style={{color: "#5cb85c"}}></span> : ''}
							<span className={"icon icon-" + icon}></span>
						</button>
					</div>
					{this.props.length ? <p className="content-card-xinfo">{this.props.length}</p> : <div className="content-card-xinfo-offset"></div>}
					<div className="card-block" style={{padding: "10px",whiteSpace: "nowrap", overflow: "hidden", textOverflow: "ellipsis"}}>
						<strong style={{}}>{title}</strong>
						<p style={{marginBottom: "-10px", maxWidth: "80%", whiteSpace: "nowrap", overflow: "hidden", textOverflow: "ellipsis"}}><img className="rounded-circle" src={userIcon} width="30" height="30" alt="" style={{marginRight: "3px", marginBottom: "3px"}} /><span style={{paddingTop:"10px"}}>{this.props.artifact.publisherName}</span></p>
						<button className="btn btn-sm btn-outline-secondary view-btn">{this.props.views} Views</button>
					</div>
				</div>
			</Link>
		);
	}
}

export default ContentCard;